import fetch from 'isomorphic-unfetch'

const Fetcher = (page) => {
    console.log("starting")
    var data = []
    var url = 'https://newsapi.org/v2/everything?' +
        'q=tech&' +
        'sortBy=popularity&' +
        'page=' + page + '&' +
        'pageSize=1&' +
        'apiKey=3b214239993247f18926b8fab6ee014f';
    fetch(url).then(response => response.json())
        .then(json => {
            //console.log(json)
            data =  json
        })
        console.log(data)
        return data

}

export default Fetcher;
